let filteredProducts = [...allProducts];

// Filter products
function filterProducts() {
    // 1. Get current URL context
    const params = new URLSearchParams(window.location.search);
    const urlSport = params.get('sport');
    const urlCategory = params.get('category');

    // 2. Determine what to filter by
    const filterSelect = document.getElementById('categoryFilter');
    const titleElement = document.getElementById('category-title');
    const priceFilter = document.getElementById('priceFilter')?.value || '';

    // 2. Determine what to filter by
    // Priority: 1. Manual Dropdown selection, 2. URL Sport, 3. URL Category
    const selectedDropdownValue = filterSelect.value;

    filteredProducts = allProducts.filter(product => {
        // --- FIXED Category Logic ---
        let categoryMatch = true;

        // If the dropdown is NOT empty, filter by that selection
        if (selectedDropdownValue !== "") {
            categoryMatch = product.category === selectedDropdownValue;
        }
        // If dropdown IS "All Categories" (""), but there's a URL category, 
        // we decide if the URL should still apply or if "All" means "All".
        // Usually, manual selection should override URL.
        else if (urlCategory) {
            categoryMatch = product.category === urlCategory;
        }

        // --- Sport Logic ---
        let sportMatch = !urlSport || product.sport === urlSport;

        // --- Price Logic ---
        let priceMatch = true;
        if (priceFilter) {
            if (priceFilter === '0-10000') priceMatch = product.price < 10000;
            else if (priceFilter === '10000-15000') priceMatch = product.price >= 10000 && product.price < 15000;
            else if (priceFilter === '15000-20000') priceMatch = product.price >= 15000 && product.price < 20000;
            else if (priceFilter === '20000+') priceMatch = product.price >= 20000;
            // Added check for your Sri Lankan Rupee values
            else if (priceFilter === 'high') priceMatch = product.price > 10000;
        }

        return categoryMatch && sportMatch && priceMatch;
    });

    // 3. Update the Page Title Dynamically
    if (urlSport) {
        titleElement.innerText = capitalizeCategory(urlSport);
    } else if (selectedDropdownValue) {
        titleElement.innerText = filterSelect.options[filterSelect.selectedIndex].text;
    } else if (urlCategory) {
        titleElement.innerText = capitalizeCategory(urlCategory);
    } else {
        titleElement.innerText = "All Products";
    }

    displayProducts();
}

// Update the display logic to handle the "sport" property safely
function displayProducts() {
    const productsGrid = document.getElementById('productsGrid');
    if (!productsGrid) return;

    productsGrid.innerHTML = filteredProducts.map(product => {
        // Check if the image string contains 'linear-gradient'
        const isGradient = product.image.includes('linear-gradient');

        // Define the visual part based on the check
        const visualContent = isGradient
            ? `<div class="product-visual" style="background: ${product.image}; height: 200px; width: 100%;"></div>`
            : `<img src="${product.image}" alt="${product.name}" class="product-img">`;

        return `
            <div class="product-card" style="background-color: #c1c1c1; border: 2px solid #361515; margin:2px; text-align: center;">
                <div class="product-image-container" >
                    ${visualContent}
                    <span class="product-badge">${product.price > 10000 ? 'PREMIUM' : 'SALE'}</span>
                </div>
                <h3>${product.name}</h3>
                <p class="category" style="color: #3d3e3a;">${capitalizeCategory(product.sport || product.category || '')}</p>
                <p class="price" style="color: #5c0f0f;">Rs.${product.price.toLocaleString()}</p>
                <button class="btn btn-secondary" onclick="addToCart('${product.name}', ${product.price})">Add to Cart</button>
            </div> 
        `;

    }).join('');
}


// Get category from URL
function getCategoryFromURL() {
    const params = new URLSearchParams(window.location.search);
    return params.get('category') || '';
}

// Capitalize category name
function capitalizeCategory(category) {
    return category.charAt(0).toUpperCase() + category.slice(1);
}

// Update page title based on category
function updatePageTitle() {
    const category = getCategoryFromURL();
    const titleElement = document.getElementById('category-title');

    if (titleElement) {
        if (category) {
            titleElement.textContent = capitalizeCategory(category) + ' Products';
        } else {
            titleElement.textContent = 'All Products';
        }
    }
}

// Initialize products page
document.addEventListener('DOMContentLoaded', function () {
    updatePageTitle();

    const category = getCategoryFromURL();
    if (category) {
        const categoryFilter = document.getElementById('categoryFilter');
        if (categoryFilter) {
            categoryFilter.value = category;
        }
    }

    filterProducts();
});
